import React, { Component } from 'react';
import logo from '../images/o2.svg';
import { FaAlignRight } from 'react-icons/fa';
import { Link } from 'react-router-dom';
import SimpleMenu from '../Coponent/userDropDown';
import Hostdropdown from '../Coponent/Hostdropdown';

export default class Navibar extends Component {
    state={
        isOpen:false 
    };
    handleToggle=() =>{
        this.setState({isOpen:!this.state.isOpen});
    };

    render() {
        console.log(this.props.loggedinstatus)
        if(this.props.loggedinstatus==="not_logged_in"){
            return (
                <nav className="navbar">
                    <div className="nav-center">

                        <div className="nav-header">
                            <Link to="/">
                                <img src={logo} alt="KDY" />
                            </Link>
                            <button type="button" className="nav-btn" onClick={this.handleToggle}>
                                <FaAlignRight className="nav-icon" />
                            </button>
                        </div>
                        <ul 
                            className={this.state.isOpen ? "nav-links show-nav" : "nav-links"}
                        >
                            <li>
                                <Link to="/">Home</Link>
                            </li>
                            <li>
                                <Link to="/room">Accommodations</Link>
                            </li>
                            <li>
                                <Link to="/hostsignup">Host Sign Up</Link>
                            </li>
                            <li>
                                <Link to="/signup">User Sign Up</Link>
                            </li>
                            <li>
                                <Link to="/signin">User Log In</Link>
                            </li>
                        </ul>
                    </div>  
                </nav>
            );
        }
        if(this.props.loggedinstatus==="logged_in")
        {
            return (
                <nav className="navbar">
                <div className="nav-center">
                    <div className="nav-header">
                        <Link to="/">
                            <img src={logo} alt="KDY" />
                        </Link>
                        <button type="button" className="nav-btn" onClick={this.handleToggle}>
                            <FaAlignRight className="nav-icon" />
                        </button>
                    </div>
                    <ul 
                        className={this.state.isOpen ? "nav-links show-nav" : "nav-links"}
                    >
                        <li className="menu">
                            <Link to="/">Home</Link>
                        </li>
                        <li className="menu">
                            <Link to="/room">Accommodations</Link>
                        </li>
                        <li className="menu">
                            <Link to="/hostsignup">As a host</Link>
                        </li>
                        <li className="menu">
                        <SimpleMenu />
                        </li>
                    </ul>
                </div> 
            </nav>
            )
        }
        if(this.props.loggedinstatus==="hostlogged_in"){
            return (
                <nav className="navbar">
                    <div className="nav-center">
                        <div className="nav-header">
                            <Link to="/">
                                <img src={logo} alt="KDY" />
                            </Link>
                            <button type="button" className="nav-btn" onClick={this.handleToggle}>
                                <FaAlignRight className="nav-icon" />
                            </button>
                        </div>
                        <ul 
                            className={this.state.isOpen ? "nav-links show-nav" : "nav-links"}
                        >
                            <li className="menu">
                                <Link to="/">Home</Link>
                            </li>
                            <li className="menu">
                                <Link to="/room">Accommodations</Link>
                            </li>

                            <li className="menu">
                            <Hostdropdown />
                            </li>
                        </ul>
                    </div> 
                </nav>
            );
        }
    }
}
